import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./smallparks.json";
import "./ParkPage.css";

class ParkPage extends Component {
  render() {
    let AllParkDetails = Parks.map(park => {
      return (
        <div className="parkpage-container">
          <p className="ParkPage-Name">{park.name}</p>
          <div className="Page-ImageContainer">
            <img className="Image1" src={park.images[0].url} />
          </div>
        </div>
      );
    });

    let ParkImages = Parks.map(park => {
      console.log(park.images[0]);
      //   return <img src={park.images[].url} className="ImageBox" />;
    });

    return (
      <div className="pagegrid">
        <div classname="ParkInfo">{AllParkDetails}</div>
        <div classname="ParkImages">{ParkImages}</div>
      </div>
    );
  }
}

export default ParkPage;
